import {Container, Card, Col, Row} from 'react-bootstrap'
import SingleBook from './SingleBook'

const BookList = ({books}) => (
    <Container>
        <Row>
            {
                books.map(book =>(
                    <Col>
                    <SingleBook book ={book} />
                    </Col>
                ))
            } 

        </Row>
</Container>
)

export default BookList
